values:
so as punishment for failing chemistry, my dad pulled me out of the play i was going to be in. and from the day i get my report card, im not allowed to go to any shows for a month. laaaame.



buuut, he also surprised me with a trip to NYC in feb to see a couple of plays on broadway, including SPAMALOT! i am so stoked. actually, im beyond stoked. ive wanted to see spamalot for the longest time. gahhhhh its going to be amazing! and for those of you who dont know, spamalot is the broadway version of monty python and the holy grail.&nbsp;

!!!!!!!!!
